RETURNS void
LANGUAGE plpgsql
SECURITY DEFINER
VOLATILE AS
$function$

BEGIN
  -- Delete attribute values for products that no longer match the applicability rules
  DELETE FROM attributes_product_values apv
  USING products p
  WHERE apv.attribute_id = p_attribute_id
    AND apv.product_id = p.id
    AND (
