DROP FUNCTION IF EXISTS get_changed_fields(old_row jsonb, new_row jsonb) CASCADE;

CREATE OR REPLACE FUNCTION get_changed_fields(old_row jsonb, new_row jsonb)
RETURNS jsonb
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$

DECLARE
    key text;
    changed_fields jsonb = '{}'::jsonb;
BEGIN
    FOR key IN SELECT jsonb_object_keys(new_row)
    LOOP
        -- Skip if the key doesn't exist in both objects
        IF old_row ? key AND new_row ? key THEN
            -- Only include if values are different
            IF old_row->key IS DISTINCT FROM new_row->key THEN
                changed_fields = changed_fields || jsonb_build_object(
                    key,
                    jsonb_build_object(
                        'old', old_row->key,
                        'new', new_row->key
                    )
                );
            END IF;
        END IF;
    END LOOP;
    RETURN changed_fields;
END;

$function$;

GRANT EXECUTE ON FUNCTION get_changed_fields(old_row jsonb, new_row jsonb) TO authenticated;

GRANT EXECUTE ON FUNCTION get_changed_fields(old_row jsonb, new_row jsonb) TO anon;

GRANT EXECUTE ON FUNCTION get_changed_fields(old_row jsonb, new_row jsonb) TO service_role;

