DROP FUNCTION IF EXISTS track_inventory_changes() CASCADE;

CREATE OR REPLACE FUNCTION track_inventory_changes()
RETURNS trigger
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$


DECLARE
    changes_json jsonb;
    tag_changes jsonb;
    changed_fields jsonb;
    only_timestamp_changed boolean;
BEGIN
    -- For updates to the inventory table
    IF TG_TABLE_NAME = 'inventory' AND TG_OP = 'UPDATE' THEN
        -- Check if only the timestamp changed
        only_timestamp_changed := TRUE;
        IF OLD.inventory_status IS DISTINCT FROM NEW.inventory_status THEN
            only_timestamp_changed := FALSE;
        ELSIF OLD.override_price IS DISTINCT FROM NEW.override_price THEN
            only_timestamp_changed := FALSE;
        ELSIF OLD.product_id IS DISTINCT FROM NEW.product_id THEN
            only_timestamp_changed := FALSE;
        ELSIF OLD.purchase_id IS DISTINCT FROM NEW.purchase_id THEN
            only_timestamp_changed := FALSE;
        ELSIF OLD.sale_id IS DISTINCT FROM NEW.sale_id THEN
            only_timestamp_changed := FALSE;
        END IF;

        -- Skip if only the timestamp changed
        IF only_timestamp_changed THEN
            RETURN NULL;
        END IF;

        -- Check if this is a status change
        IF OLD.inventory_status IS DISTINCT FROM NEW.inventory_status THEN
            changes_json = jsonb_build_object(
                'operation', 'STATUS_CHANGE',
                'changes', jsonb_build_object(
                    'inventory_status', jsonb_build_object(
                        'old', OLD.inventory_status,
                        'new', NEW.inventory_status
                    )
                )
            );
        -- Check if this is an override price change
        ELSIF OLD.override_price IS DISTINCT FROM NEW.override_price THEN
            changes_json = jsonb_build_object(
                'operation', 'PRICE_OVERRIDE',
                'changes', jsonb_build_object(
                    'override_price', jsonb_build_object(
                        'old', OLD.override_price,
                        'new', NEW.override_price
                    )
                )
            );
        -- For other changes
        ELSE
            -- Get only the changed fields
            changed_fields = get_changed_fields(
                to_jsonb(OLD),
                to_jsonb(NEW)
            );
            
            -- Only proceed if there are actual changes
            IF changed_fields != '{}'::jsonb THEN
                changes_json = jsonb_build_object(
                    'operation', 'UPDATE',
                    'changes', changed_fields
                );
            END IF;
        END IF;

        -- Only insert if there are actual changes
        IF changes_json IS NOT NULL THEN
            VALUES (NEW.id, changes_json);
        END IF;
    END IF;

    -- For changes to inventory_tag_relationships
    IF TG_TABLE_NAME = 'inventory_tag_relationships' THEN
        IF TG_OP = 'INSERT' THEN
            -- Get tag information
            SELECT jsonb_build_object(
                'id', t.id,
                'name', t.name,
                'color', t.color
            ) INTO tag_changes
            FROM view_inventory_tags t
            WHERE t.id = NEW.tag_id;

            changes_json = jsonb_build_object(
                'operation', 'ADD_TAG',
                'tag', tag_changes
            );

            -- Update the inventory's updated_at timestamp silently
            UPDATE inventory 
            SET inventory_updated_at = NOW()
            WHERE id = NEW.inventory_id;
        ELSIF TG_OP = 'DELETE' THEN
            -- Get tag information
            SELECT jsonb_build_object(
                'id', t.id,
                'name', t.name,
                'color', t.color
            ) INTO tag_changes
            FROM view_inventory_tags t
            WHERE t.id = OLD.tag_id;

            changes_json = jsonb_build_object(
                'operation', 'REMOVE_TAG',
                'tag', tag_changes
            );

            -- Update the inventory's updated_at timestamp silently
            UPDATE inventory 
            SET inventory_updated_at = NOW()
            WHERE id = OLD.inventory_id;
        END IF;

        VALUES (
            CASE TG_OP 
                WHEN 'INSERT' THEN NEW.inventory_id 
                WHEN 'DELETE' THEN OLD.inventory_id 
            END,
            changes_json
        );
    END IF;

    RETURN NULL;
END;


$function$;

GRANT EXECUTE ON FUNCTION track_inventory_changes() TO authenticated;

GRANT EXECUTE ON FUNCTION track_inventory_changes() TO anon;

GRANT EXECUTE ON FUNCTION track_inventory_changes() TO service_role;

