DECLARE
    changes_json jsonb;
    tag_changes jsonb;
    changed_fields jsonb;
BEGIN
    -- For updates to the products table
    IF TG_OP = 'UPDATE' THEN
        -- Get only the changed fields
        changed_fields = get_changed_fields(
            to_jsonb(OLD),
            to_jsonb(NEW)
        );
        
        -- Only proceed if there are actual changes
        IF changed_fields != '{}'::jsonb THEN
            changes_json = jsonb_build_object(
                'operation', 'UPDATE',
                'changes', changed_fields
            );
            
            VALUES (NEW.id, changes_json);
        END IF;
    END IF;

    -- For changes to product_tag_relationships
    IF TG_TABLE_NAME = 'product_tag_relationships' THEN
        IF TG_OP = 'INSERT' THEN
            -- Get tag information
            SELECT jsonb_build_object(
                'id', t.id,
                'name', t.name,
                'color', t.color
            ) INTO tag_changes
            FROM view_product_tags t
            WHERE t.id = NEW.tag_id;

            changes_json = jsonb_build_object(
                'operation', 'ADD_TAG',
                'tag', tag_changes
            );
        ELSIF TG_OP = 'DELETE' THEN
            -- Get tag information
            SELECT jsonb_build_object(
                'id', t.id,
                'name', t.name,
                'color', t.color
            ) INTO tag_changes
            FROM view_product_tags t
            WHERE t.id = OLD.tag_id;

            changes_json = jsonb_build_object(
                'operation', 'REMOVE_TAG',
                'tag', tag_changes
            );
        END IF;

        VALUES (
            CASE TG_OP 
                WHEN 'INSERT' THEN NEW.product_id 
                WHEN 'DELETE' THEN OLD.product_id 
            END,
            changes_json
        );
    END IF;

    RETURN NULL;
END;

$function$;

GRANT EXECUTE ON FUNCTION track_product_changes() TO authenticated;

GRANT EXECUTE ON FUNCTION track_product_changes() TO anon;

GRANT EXECUTE ON FUNCTION track_product_changes() TO service_role;

DROP FUNCTION IF EXISTS update_all_product_prices() CASCADE;

CREATE OR REPLACE FUNCTION update_all_product_prices()
RETURNS trigger
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$

BEGIN
    -- Update all prices in the product_prices table that have USD values
    UPDATE product_prices
    SET 
        price_nok = price_usd * NEW.rate,
        price_nok_fixed = CEIL((price_usd * NEW.rate) / 10) * 10,
        updated_at = updated_at  -- Keep the original timestamp
    WHERE price_usd IS NOT NULL;

    -- No need to update the products table, as it does not contain price-related columns
    RETURN NEW;
END;

$function$;

GRANT EXECUTE ON FUNCTION update_all_product_prices() TO authenticated;

GRANT EXECUTE ON FUNCTION update_all_product_prices() TO anon;

GRANT EXECUTE ON FUNCTION update_all_product_prices() TO service_role;

DROP FUNCTION IF EXISTS update_all_products_nok() CASCADE;

CREATE OR REPLACE FUNCTION update_all_products_nok()
RETURNS trigger
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$
BEGIN
    UPDATE products
    SET 
        price_nok = CASE 
            WHEN price_usd IS NOT NULL THEN price_usd * NEW.rate 
            ELSE price_nok 
        END,
        price_nok_fixed = CASE 
            WHEN price_usd IS NOT NULL THEN CEIL((price_usd * NEW.rate) / 10) * 10 
            ELSE price_nok_fixed 
        END,
        price_new_nok = CASE 
            WHEN price_new_usd IS NOT NULL THEN price_new_usd * NEW.rate 
            ELSE price_new_nok 
        END,
        price_new_nok_fixed = CASE 
            WHEN price_new_usd IS NOT NULL THEN CEIL((price_new_usd * NEW.rate) / 10) * 10 
            ELSE price_new_nok_fixed 
        END;
    RETURN NEW;
END;
$function$;

GRANT EXECUTE ON FUNCTION update_all_products_nok() TO authenticated;

GRANT EXECUTE ON FUNCTION update_all_products_nok() TO anon;

GRANT EXECUTE ON FUNCTION update_all_products_nok() TO service_role;

