CREATE OR REPLACE FUNCTION update_timestamp()
RETURNS trigger
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$

BEGIN
    -- Update the timestamp field based on the table
    IF TG_TABLE_NAME = 'products' THEN
        NEW.products_updated_at = CURRENT_TIMESTAMP;
    ELSE
        NEW.updated_at = CURRENT_TIMESTAMP;
    END IF;
    RETURN NEW;
END;

$function$;

GRANT EXECUTE ON FUNCTION update_timestamp() TO authenticated;

GRANT EXECUTE ON FUNCTION update_timestamp() TO anon;

GRANT EXECUTE ON FUNCTION update_timestamp() TO service_role;

DROP FUNCTION IF EXISTS upsert_product_price(p_product_id integer, p_price_type price_type, p_price_usd numeric) CASCADE;

CREATE OR REPLACE FUNCTION upsert_product_price(p_product_id integer, p_price_type price_type, p_price_usd numeric)
RETURNS void
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$

DECLARE
    current_rate numeric;
BEGIN
    -- Get current exchange rate
    SELECT rate INTO current_rate
    FROM currency_rates
    ORDER BY updated_at DESC
    LIMIT 1;

    -- Insert or update the price
        product_id,
        price_type,
        price_usd,
        price_nok,
        price_nok_fixed
    ) VALUES (
        p_product_id,
        p_price_type,
        p_price_usd,
        p_price_usd * current_rate,
        p_price_usd * current_rate
    )
    ON CONFLICT (product_id, price_type) DO UPDATE SET
        price_usd = EXCLUDED.price_usd,
        price_nok = EXCLUDED.price_usd * current_rate,
        price_nok_fixed = EXCLUDED.price_usd * current_rate,
        updated_at = CURRENT_TIMESTAMP;
END;

$function$;

GRANT EXECUTE ON FUNCTION upsert_product_price(p_product_id integer, p_price_type price_type, p_price_usd numeric) TO authenticated;

GRANT EXECUTE ON FUNCTION upsert_product_price(p_product_id integer, p_price_type price_type, p_price_usd numeric) TO anon;

GRANT EXECUTE ON FUNCTION upsert_product_price(p_product_id integer, p_price_type price_type, p_price_usd numeric) TO service_role;

DROP FUNCTION IF EXISTS validate_product_group_ids() CASCADE;

CREATE OR REPLACE FUNCTION validate_product_group_ids()
RETURNS trigger
LANGUAGE plpgsql
SECURITY INVOKER
VOLATILE AS
$function$

BEGIN
  IF NEW.product_group_ids IS NOT NULL THEN
    IF EXISTS (
      SELECT 1 
      FROM unnest(NEW.product_group_ids) AS pg_id 
      LEFT JOIN product_groups ON product_groups.id = pg_id 
      WHERE product_groups.id IS NULL
    ) THEN
      RAISE EXCEPTION 'Invalid product group ID in array';
    END IF;
  END IF;
  RETURN NEW;
END;

$function$;

GRANT EXECUTE ON FUNCTION validate_product_group_ids() TO authenticated;

GRANT EXECUTE ON FUNCTION validate_product_group_ids() TO anon;

GRANT EXECUTE ON FUNCTION validate_product_group_ids() TO service_role;

