DROP VIEW IF EXISTS view_inventory CASCADE;

CREATE VIEW view_inventory AS
 WITH inventory_prices AS (
         SELECT i_1.id AS inventory_id,
            i_1.override_price,
            ( SELECT jsonb_object_agg(pp.price_type::text, jsonb_build_object('usd', pp.price_usd, 'nok', pp.price_nok, 'nok_fixed', pp.price_nok_fixed, 'updated_at', pp.updated_at)) AS jsonb_object_agg
                   FROM product_prices pp
                  WHERE pp.product_id = i_1.product_id) AS prices,
            ( SELECT pp.price_nok_fixed
                   FROM product_prices pp
                  WHERE pp.product_id = i_1.product_id AND pp.price_type = 'complete'::price_type) AS complete_price_nok_fixed,
            ( SELECT pp.price_nok_fixed
                   FROM product_prices pp
                  WHERE pp.product_id = i_1.product_id AND pp.price_type = 'new'::price_type) AS new_price_nok_fixed,
            ( SELECT (EXISTS ( SELECT 1
                           FROM inventory_tag_relationships itr
                             JOIN inventory_tags it ON it.id = itr.tag_id
                          WHERE itr.inventory_id = i_1.id AND it.name::text = 'New/Sealed'::text)) OR (EXISTS ( SELECT 1
                           FROM product_tag_relationships ptr
                             JOIN product_tags pt ON pt.id = ptr.tag_id
                          WHERE ptr.product_id = i_1.product_id AND pt.name::text = 'New/Sealed'::text)) AS "exists") AS has_new_sealed_tag
           FROM inventory i_1
        ), inventory_tags_agg AS (
         SELECT itr.inventory_id,
            jsonb_agg(jsonb_build_object('id', it.id, 'name', it.name, 'display_type', it.display_type, 'display_value', it.display_value, 'description', it.description, 'color', it.color)) AS tags
           FROM inventory_tag_relationships itr
             JOIN inventory_tags it ON it.id = itr.tag_id
          GROUP BY itr.inventory_id
        ), product_tags_agg AS (
         SELECT p_1.id AS product_id,
            jsonb_agg(jsonb_build_object('id', pt.id, 'name', pt.name, 'display_type', pt.display_type, 'display_value', pt.display_value, 'description', pt.description, 'color', pt.color)) AS product_tags
           FROM products p_1
             JOIN product_tag_relationships ptr ON ptr.product_id = p_1.id
             JOIN product_tags pt ON pt.id = ptr.tag_id
          GROUP BY p_1.id
        )
 SELECT i.id AS inventory_id,
    i.product_id,
    i.purchase_id,
    i.sale_id,
    i.inventory_status,
    i.created_at AS inventory_created_at,
    i.inventory_updated_at,
    EXTRACT(epoch FROM now() - i.inventory_updated_at) AS inventory_updated_secondsago,
    p.product_title,
    p.product_variant,
    p.release_year,
    p.is_product_active,
    p.product_notes,
    p.created_at AS product_created_at,
    p.products_updated_at AS product_updated_at,
    p.product_group AS product_group_name,
    p.product_type AS product_type_name,
    p.rating AS rating_name,
    p.region AS region_name,
    ip.override_price,
    ip.prices,
    ip.complete_price_nok_fixed,
    ip.new_price_nok_fixed,
        CASE
            WHEN ip.override_price IS NOT NULL THEN ip.override_price
            WHEN i.inventory_status::text = 'Sold'::text AND si.sold_price IS NOT NULL THEN si.sold_price
            WHEN ip.has_new_sealed_tag THEN ip.new_price_nok_fixed
            ELSE ip.complete_price_nok_fixed
        END AS final_price,
    p.publisher,
    p.developer,
    p.genre,
    p.image_url,
    p.ean_gtin,
    p.asin,
    p.epid,
    p.pricecharting_id,
    p.pricecharting_url,
    pu.seller_name AS purchase_seller,
    pu.origin AS purchase_origin,
    pu.purchase_cost,
    pu.purchase_date,
    pu.purchase_notes,
    s.buyer_name AS sale_buyer,
    s.sale_status,
    s.sale_date,
    s.sale_notes,
    si.sold_price,
    ( SELECT array_agg(ib.barcode) AS array_agg
           FROM inventory_barcodes ib
          WHERE ib.inventory_id = i.id) AS barcodes,
    count(*) OVER (PARTITION BY i.product_id) AS total_count,
    count(*) FILTER (WHERE i.inventory_status::text = 'Normal'::text) OVER (PARTITION BY i.product_id) AS normal_count,
    count(*) FILTER (WHERE i.inventory_status::text = 'Collection'::text) OVER (PARTITION BY i.product_id) AS collection_count,
    count(*) FILTER (WHERE i.inventory_status::text = 'For Sale'::text) OVER (PARTITION BY i.product_id) AS for_sale_count,
    count(*) FILTER (WHERE i.inventory_status::text = 'Sold'::text) OVER (PARTITION BY i.product_id) AS sold_count,
    COALESCE(ita.tags, '[]'::jsonb) AS tags,
    COALESCE(pta.product_tags, '[]'::jsonb) AS product_tags
   FROM inventory i
     JOIN products p ON i.product_id = p.id
     LEFT JOIN inventory_prices ip ON ip.inventory_id = i.id
     LEFT JOIN purchases pu ON i.purchase_id = pu.id
     LEFT JOIN sales s ON i.sale_id = s.id
     LEFT JOIN sale_items si ON si.inventory_id = i.id
     LEFT JOIN inventory_tags_agg ita ON ita.inventory_id = i.id
     LEFT JOIN product_tags_agg pta ON pta.product_id = i.product_id;;

DROP VIEW IF EXISTS view_inventory_tags CASCADE;

CREATE VIEW view_inventory_tags AS
 SELECT t.id,
    t.name,
    t.product_groups,
    t.product_types,
    t.description,
    t.display_type,
    t.display_value,
    t.color,
    t.created_at,
    COALESCE(count(r.inventory_id), 0::bigint)::integer AS relationships_count
   FROM inventory_tags t
     LEFT JOIN inventory_tag_relationships r ON r.tag_id = t.id
  GROUP BY t.id;;

DROP VIEW IF EXISTS view_product_tags CASCADE;

CREATE VIEW view_product_tags AS
 SELECT t.id,
    t.name,
    t.product_groups,
    t.product_types,
    t.description,
    t.display_type,
    t.display_value,
    t.color,
    t.created_at,
    COALESCE(count(r.product_id), 0::bigint)::integer AS relationships_count
   FROM product_tags t
     LEFT JOIN product_tag_relationships r ON r.tag_id = t.id
  GROUP BY t.id;;

DROP VIEW IF EXISTS view_products CASCADE;

CREATE VIEW view_products AS
 WITH inventory_counts AS (
         SELECT i.product_id,
            count(*) FILTER (WHERE i.inventory_status::text = 'Normal'::text) AS normal_count,
            count(*) FILTER (WHERE i.inventory_status::text = 'For Sale'::text) AS for_sale_count,
            count(*) FILTER (WHERE i.inventory_status::text = 'Collection'::text) AS collection_count,
            count(*) FILTER (WHERE i.inventory_status::text = 'Sold'::text) AS sold_count,
            count(*) AS total_count,
            max(i.inventory_updated_at) AS updated_at
           FROM inventory i
          GROUP BY i.product_id
        ), sale_stats AS (
         SELECT i.product_id,
            count(DISTINCT s.id) AS total_sales,
            count(DISTINCT s.buyer_name) AS unique_buyers,
            avg(si.sold_price) AS avg_sale_price,
            max(si.sold_price) AS max_sale_price,
            min(si.sold_price) AS min_sale_price
           FROM inventory i
             JOIN sales s ON i.sale_id = s.id
             JOIN sale_items si ON si.inventory_id = i.id
          GROUP BY i.product_id
        ), price_data AS (
         SELECT product_prices.product_id,
            jsonb_object_agg(product_prices.price_type::text, jsonb_build_object('usd', product_prices.price_usd, 'nok', product_prices.price_nok, 'nok_fixed', product_prices.price_nok_fixed, 'updated_at', product_prices.updated_at)) AS prices,
            max(product_prices.updated_at) AS prices_updated_at,
            max(
                CASE
                    WHEN product_prices.price_type = 'loose'::price_type THEN product_prices.price_nok_fixed
                    ELSE NULL::numeric
                END) AS loose_price_nok_fixed,
            max(
                CASE
                    WHEN product_prices.price_type = 'loose'::price_type THEN product_prices.price_nok
                    ELSE NULL::numeric
                END) AS loose_price_nok
           FROM product_prices
          GROUP BY product_prices.product_id
        ), product_tags_agg AS (
         SELECT ptr.product_id,
            jsonb_agg(jsonb_build_object('id', pt.id, 'name', pt.name, 'display_type', pt.display_type, 'display_value', pt.display_value, 'description', pt.description, 'color', pt.color)) AS tags
           FROM product_tag_relationships ptr
             JOIN product_tags pt ON pt.id = ptr.tag_id
          GROUP BY ptr.product_id
        )
 SELECT p.id AS product_id,
    p.product_title,
    p.product_variant,
    p.release_year,
    p.is_product_active,
    p.product_notes,
    p.created_at AS product_created_at,
    GREATEST(p.products_updated_at, COALESCE(ic.updated_at, '1970-01-01 00:00:00'::timestamp without time zone::timestamp with time zone), COALESCE(pd.prices_updated_at, '1970-01-01 00:00:00'::timestamp without time zone::timestamp with time zone)) AS products_updated_at,
    EXTRACT(epoch FROM now() - GREATEST(p.products_updated_at, COALESCE(ic.updated_at, '1970-01-01 00:00:00'::timestamp without time zone::timestamp with time zone), COALESCE(pd.prices_updated_at, '1970-01-01 00:00:00'::timestamp without time zone::timestamp with time zone))) AS products_updated_secondsago,
    p.product_group AS product_group_name,
    p.product_type AS product_type_name,
    p.rating AS rating_name,
    p.region AS region_name,
    pd.prices,
    COALESCE(pd.loose_price_nok_fixed, pd.loose_price_nok) AS final_price,
    p.pricecharting_id,
    p.pricecharting_url,
    p.publisher,
    p.developer,
    p.genre,
    p.image_url,
    p.ean_gtin,
    p.asin,
    p.epid,
    COALESCE(ic.normal_count, 0::bigint) AS normal_count,
    COALESCE(ic.for_sale_count, 0::bigint) AS for_sale_count,
    COALESCE(ic.collection_count, 0::bigint) AS collection_count,
    COALESCE(ic.sold_count, 0::bigint) AS sold_count,
    COALESCE(ic.total_count, 0::bigint) AS total_count,
    COALESCE(ss.total_sales, 0::bigint) AS total_sales,
    COALESCE(ss.unique_buyers, 0::bigint) AS unique_buyers,
    ss.avg_sale_price,
    ss.max_sale_price,
    ss.min_sale_price,
    COALESCE(pta.tags, '[]'::jsonb) AS tags
   FROM products p
     LEFT JOIN inventory_counts ic ON ic.product_id = p.id
     LEFT JOIN sale_stats ss ON ss.product_id = p.id
     LEFT JOIN price_data pd ON pd.product_id = p.id
     LEFT JOIN product_tags_agg pta ON pta.product_id = p.id;;

DROP VIEW IF EXISTS view_purchases CASCADE;

CREATE VIEW view_purchases AS
 WITH inventory_with_prices AS (
         SELECT i.purchase_id,
            i.id AS inventory_id,
            i.override_price,
                CASE
                    WHEN (EXISTS ( SELECT 1
                       FROM inventory_tag_relationships itr
                      WHERE itr.inventory_id = i.id AND itr.tag_id = 2)) THEN COALESCE((((vp.prices ->> 'new'::text)::jsonb) ->> 'nok_fixed'::text)::numeric, (((vp.prices ->> 'complete'::text)::jsonb) ->> 'nok_fixed'::text)::numeric)
                    ELSE (((vp.prices ->> 'complete'::text)::jsonb) ->> 'nok_fixed'::text)::numeric
                END AS base_price
           FROM inventory i
             LEFT JOIN view_products vp ON i.product_id = vp.product_id
          WHERE i.purchase_id IS NOT NULL
        )
 SELECT p.id AS purchase_id,
    p.seller_name AS seller,
    p.origin,
    p.purchase_date,
    p.purchase_notes,
    p.purchase_cost,
    p.created_at,
    count(iwp.inventory_id) AS item_count,
    sum(COALESCE(iwp.override_price, iwp.base_price, 0::numeric)) AS total_value
   FROM purchases p
     LEFT JOIN inventory_with_prices iwp ON p.id = iwp.purchase_id
  GROUP BY p.id, p.seller_name, p.origin, p.purchase_date, p.purchase_notes, p.purchase_cost, p.created_at
  ORDER BY p.purchase_date DESC;;

DROP VIEW IF EXISTS view_sale_items CASCADE;

CREATE VIEW view_sale_items AS
 SELECT si.id AS sale_item_id,
    si.sale_id,
    si.inventory_id,
    si.sold_price,
    p.product_title,
    p.product_variant,
    p.product_group AS product_group_name,
    p.product_type AS product_type_name,
    p.rating AS rating_name,
    p.region AS region_name
   FROM sale_items si
     JOIN inventory i ON si.inventory_id = i.id
     JOIN products p ON i.product_id = p.id;;

DROP VIEW IF EXISTS view_sales CASCADE;

CREATE VIEW view_sales AS
 SELECT s.id AS sale_id,
    s.buyer_name,
    s.sale_total,
    s.sale_date,
    s.sale_notes,
    s.created_at,
    s.number_of_items,
    s.sale_status,
    count(si.id) AS item_count,
    sum(si.sold_price) AS total_sold_price,
    array_agg(p.product_title) AS product_titles,
    array_agg(p.product_variant) AS product_variants,
    array_agg(p.product_group) AS product_groups
   FROM sales s
     LEFT JOIN sale_items si ON s.id = si.sale_id
     LEFT JOIN inventory i ON si.inventory_id = i.id
     LEFT JOIN products p ON i.product_id = p.id
  GROUP BY s.id, s.buyer_name, s.sale_total, s.sale_date, s.sale_notes, s.created_at, s.number_of_items, s.sale_status;;


COMMIT;
